import logo from './logo.svg';
import './App.css';
import { EducationModel } from './model/education';
import useEffect from 'react';

function App() {

  //Need to move this code outside of this function and into the useEffect for asynchronous operations
  //check with chatgpt on this
  //tonight's goal is to build the model wrapper for the backend so that the remainder focus is on the frontend
  //ui look


  useEffect(() => {
    let educationModel = new EducationModel()
    let educations = educationModel.getEducation()
    console.log(educations[0])
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
